BEGIN TRANSACTION;
CREATE TABLE "Article" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "headline" varchar(100) NOT NULL);
CREATE TABLE "Article_publications" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "article_id" bigint NOT NULL REFERENCES "Article" ("id") DEFERRABLE INITIALLY DEFERRED, "publication_id" bigint NOT NULL REFERENCES "Publication" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Brand" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "description" text NOT NULL, "country" text NOT NULL, "icon" text NOT NULL);
CREATE TABLE "Brand_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "brand_id" bigint NOT NULL REFERENCES "Brand" ("id") DEFERRABLE INITIALLY DEFERRED, "category_id" bigint NOT NULL REFERENCES "Category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "description" text NOT NULL, "icon" text NOT NULL, "category_parent_id" bigint NULL REFERENCES "Category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Detail" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "screen" varchar(100) NOT NULL, "operating_system" varchar(100) NOT NULL, "rear_camera" varchar(100) NOT NULL, "front_camera" varchar(100) NOT NULL, "chip" varchar(50) NOT NULL, "RAM" varchar(100) NOT NULL, "sim" varchar(200) NOT NULL, "battery" varchar(50) NOT NULL, "adapter" varchar(50) NOT NULL, "memory" varchar(200) NOT NULL);
CREATE TABLE "Order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "create_date" date NOT NULL, "total_amount" integer NULL, "phone" varchar(10) NOT NULL, "address" text NOT NULL, "status" integer NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "OrderDetail" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "amount" integer NOT NULL, "order_id" bigint NOT NULL REFERENCES "Order" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "Product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Pet" ("id" varchar(10) NOT NULL PRIMARY KEY, "name" varchar(30) NOT NULL, "age" integer NOT NULL, "type" varchar(3) NOT NULL, "weight" real NOT NULL, "length" integer NOT NULL, "color" varchar(7) NOT NULL, "vacinated" bool NOT NULL, "dewormed" bool NOT NULL, "sterilized" bool NOT NULL);
CREATE TABLE "Place" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "address" varchar(80) NOT NULL);
CREATE TABLE "Product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "price" integer NOT NULL, "stock_quantity" integer NOT NULL, "image" text NOT NULL, "status" bool NOT NULL, "brand_id" bigint NOT NULL REFERENCES "Brand" ("id") DEFERRABLE INITIALLY DEFERRED, "category_id" bigint NOT NULL REFERENCES "Category" ("id") DEFERRABLE INITIALLY DEFERRED, "detail_id" bigint NOT NULL REFERENCES "Detail" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "ProductImage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "path" text NOT NULL, "product_id" bigint NOT NULL REFERENCES "Product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Product_tags" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_id" bigint NOT NULL REFERENCES "Product" ("id") DEFERRABLE INITIALLY DEFERRED, "tag_id" bigint NOT NULL REFERENCES "myshop_tag" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Promotion" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "discount" integer NOT NULL, "start_date" date NOT NULL, "end_date" date NOT NULL, "product_id" bigint NOT NULL REFERENCES "Product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Publication" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(30) NOT NULL);
CREATE TABLE "Restaurant" ("place_id" bigint NOT NULL PRIMARY KEY REFERENCES "Place" ("id") DEFERRABLE INITIALLY DEFERRED, "serves_hot_dogs" bool NOT NULL, "serves_pizza" bool NOT NULL);
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE "myapp_student" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(30) NOT NULL, "age" integer NOT NULL, "gender" bool NOT NULL, "email" varchar(10) NOT NULL, "phone" varchar(10) NOT NULL, "address" text NOT NULL);
CREATE TABLE "myshop_rating" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "stars" integer NOT NULL, "product_id" bigint NOT NULL REFERENCES "Product" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "myshop_tag" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL);
